    public static int converter(ArrayList<Integer> x){
        int num = 0;
        int k = 0;
        if (x.size() != 0){
            for (int i = x.size()-1; i > -1; i--) {
                num = num + (x.get(i) * (int)Math.pow(2, k));
                k++;
            }
        }
        return num;
    }



